import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  ResponsiveContainer,
} from "recharts";

function Dashboard({ books, onBorrow }) {
  const totalQty = books.reduce((sum, b) => sum + Number(b.quantity || 0), 0);
  const totalValue = books.reduce(
    (sum, b) => sum + Number(b.price || 0) * Number(b.quantity || 0),
    0
  );

  // Chart data
  const data = books.map(b => ({
    name: b.title || "Untitled",
    stock: Number(b.quantity || 0),
  }));

  const availableBooks = books.filter(b => b.quantity > 0);

  return (
    <div className="bg-white p-6 rounded shadow space-y-6">
      <h2 className="text-2xl font-semibold">ðŸ“Š Dashboard</h2>

      {/* Stats */}
      <div className="flex gap-8 text-lg">
        <p>
          <span className="font-bold">Total Books in Stock:</span> {totalQty}
        </p>
        <p>
          <span className="font-bold">Total Inventory Value:</span> M{" "}
          {totalValue.toFixed(2)}
        </p>
      </div>

      {/* Chart */}
      <div style={{ width: "100%", height: 300 }}>
        {data.length === 0 ? (
          <p className="text-gray-500 text-center mt-10">
            No data available for chart.
          </p>
        ) : (
          <ResponsiveContainer width="100%" height="100%">
            <BarChart
              data={data}
              margin={{ top: 20, right: 20, left: 0, bottom: 40 }}
            >
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" angle={-30} textAnchor="end" interval={0} />
              <YAxis allowDecimals={false} />
              <Tooltip />
              <Bar dataKey="stock" fill="#3b82f6" />
            </BarChart>
          </ResponsiveContainer>
        )}
      </div>

      {/* Inventory Table */}
      <div>
        <h3 className="text-xl font-semibold mb-3">ðŸ“š Inventory List</h3>
        {books.length === 0 ? (
          <p className="text-gray-500">No books in inventory.</p>
        ) : (
          <table className="w-full border-collapse border border-gray-300">
            <thead>
              <tr className="bg-gray-100">
                <th className="border border-gray-300 px-4 py-2 text-left">Title</th>
                <th className="border border-gray-300 px-4 py-2 text-left">Author</th>
                <th className="border border-gray-300 px-4 py-2 text-center">Quantity</th>
                <th className="border border-gray-300 px-4 py-2 text-center">Price (M)</th>
                <th className="border border-gray-300 px-4 py-2 text-center">Action</th>
              </tr>
            </thead>
            <tbody>
              {books.map(b => (
                <tr key={b.id}>
                  <td className="border border-gray-300 px-4 py-2">{b.title}</td>
                  <td className="border border-gray-300 px-4 py-2">{b.author}</td>
                  <td className="border border-gray-300 px-4 py-2 text-center">
                    {b.quantity}
                  </td>
                  <td className="border border-gray-300 px-4 py-2 text-center">
                    {Number(b.price).toFixed(2)}
                  </td>
                  <td className="border border-gray-300 px-4 py-2 text-center">
                    {b.quantity > 0 ? (
                      <button
                        onClick={() => onBorrow(b.id)}
                        className="bg-green-500 text-white px-3 py-1 rounded hover:bg-green-600"
                      >
                        Borrow
                      </button>
                    ) : (
                      <span className="text-gray-400">Out of stock</span>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
